import React from 'react';
import '../App.css';
import { Link } from 'react-router-dom';

function Homepage() {
  return (
    <div>This is Homepage.
      <div className="home-link">
        <Link exact to='/tutors'>I am a tutor.</Link>
        <Link exact to='/students'>Show me the students.</Link>
      </div>

    </div>
  );
}

export default Homepage;
